import React, { Fragment, Component } from 'react'
import { Input, Label } from 'reactstrap'
import './LoginForm.css'

export class LoginForm  extends Component{
	state = {
		value: ''
	}
	handle = event => {
		if (event.keyCode == 13){
			this.setState({
				value:event.target.value
			})
			event.target.value = ''
		}
	}
	render(){
		return (
			<Fragment>
				<Label color='danger' > Бактериальное прозвище? </Label>
				<Input  onKeyDown={this.handle}/>
			</Fragment>
		)
	}
}
